import ReactDOM from "react-dom/client";

function Greeting() {
  return (
    <>
      <Person />
      <Message />
    </>
  );
}

const Person = () => <p>Nisum</p>;
const Message = () => {
  return <p> This is the message </p>;
};
const root = ReactDOM.createRoot(document.getElementById("root"));

root.render(<Greeting />);
